#%%
import base64
import matplotlib.pyplot as plt
import numpy as np
import json
from ast import literal_eval

data1encoded = ''
data1bytes = base64.b64decode(data1encoded)
data1 = literal_eval(data1bytes.decode('utf8'))

data2encoded = ''
data2bytes = base64.b64decode(data2encoded)
data2 = literal_eval(data2bytes.decode('utf8'))

data3encoded = ''
data3bytes = base64.b64decode(data3encoded)
data3 = literal_eval(data3bytes.decode('utf8'))

scores1 = []
gravity1 = []
pipeInterval1 = []
pipeHeight1 = []
for data in data1:
    scores1.append(data['score'])
    gravity1.append(data['gravity'])
    pipeInterval1.append(data['pipeInterval'])
    pipeHeight1.append(data['pipeheight'])

scores2 = []
gravity2 = []
pipeInterval2 = []
pipeHeight2 = []
for data in data2:
    scores2.append(data['score'])
    gravity2.append(data['gravity'])
    pipeInterval2.append(data['pipeInterval'])
    pipeHeight2.append(data['pipeheight'])

scores3 = []
gravity3 = []
pipeInterval3 = []
pipeHeight3 = []
for data in data3:
    scores3.append(data['score'])
    gravity3.append(data['gravity'])
    pipeInterval3.append(data['pipeInterval'])
    pipeHeight3.append(data['pipeheight'])

x = np.arange(1, 11, 1)

fig, ax = plt.subplots()  # Create a figure containing a single axes.
ax.plot(x, scores1[:10], label='player1')
ax.plot(x, scores2[:10], label='player2')
ax.plot(x, scores3[:10], label='player3')

plt.xticks(x)
ax.set_xlabel('Playthrough')
ax.set_ylabel('Score')
ax.set_title('Scores over 10 playthroughs')
ax.legend()

fig2, ax2 = plt.subplots()  # Create a figure containing a single axes.
ax2.plot(x, gravity1[:10], label='player1')
ax2.plot(x, gravity2[:10], label='player2')
ax2.plot(x, gravity3[:10], label='player3')

plt.xticks(x)
ax2.set_xlabel('Playthrough')
ax2.set_ylabel('Gravity')
ax2.set_title('Gravity strength over 10 playthroughs')
ax2.legend()

fig3, ax3 = plt.subplots()  # Create a figure containing a single axes.
ax3.plot(x, pipeInterval1[:10], label='player1')
ax3.plot(x, pipeInterval2[:10], label='player2')
ax3.plot(x, pipeInterval3[:10], label='player3')

plt.xticks(x)
ax3.set_xlabel('Playthrough')
ax3.set_ylabel('Pipe Interval Distance')
ax3.set_title('Pipe interval distance over 10 playthroughs')
ax3.legend()

fig4, ax4 = plt.subplots()  # Create a figure containing a single axes.
ax4.plot(x, pipeHeight1[:10], label='player1')
ax4.plot(x, pipeHeight2[:10], label='player2')
ax4.plot(x, pipeHeight3[:10], label='player3')

plt.xticks(x)
ax4.set_xlabel('Playthrough')
ax4.set_ylabel('Pipe Height')
ax4.set_title('Pipe height over 10 playthroughs')
ax4.legend()
